        "title": "GoPro Awards: Tree Well Rescue at Mt. Baker",
        "description": "Tree wells are a danger wherever there is fresh snow. Francis Zuber was skiing in Washington when he caught glance of a partially buried snowboard. Ian Steger, a rider from a different group, was buried upside-down and unable to free himself. Francis, trained in avalanche-rescue protocol, sprung into action to clear Ian's airway.\n\nThe mountains don't care how much experience you have or how careful you are. Accidents can and will happen—riding with company that is prepared and educated is the best way to stay safe in dangerous terrain. Thank you, GoPro Awards recipient Francis, for showing us what it means to \"Be a HERO\" 🙏\n\nTap the link to read the full story in Francis' words 👉 https://gopro.com/news/mount-baker-ski-rescue-caught-on-gopro\n\n\nShot 100% on GoPro: https://bit.ly/3UkzlyS\nGet stoked and subscribe: http://goo.gl/HgVXpQ\n\n\nFor more from GoPro, follow us:\nFacebook: https://www.facebook.com/gopro\nTwitter: https://twitter.com/gopro\nInstagram: https://instagram.com/gopro\nTikTok: https://www.tiktok.com/@gopro\nThe Current: https://gopro.com/news\nGoPro: https://gopro.com/channel/\n#GoPro #GoProSnow #Snowboarding #Skiing #Safety",
